INSERT INTO `evaluation_remarks` (`id`, `procedure`, `remarks`, `created_at`, `updated_at`, `title`) VALUES
(1, 4227, '<p>\r\n<style type=\"text/css\">body,div,table,thead,tbody,tfoot,tr,th,td,p { font-family:\"Calibri\"; font-size:x-small }\r\n		a.comment-indicator:hover + comment { background:#ffd; position:absolute; display:block; border:1px solid black; padding:0.5em;  } \r\n		a.comment-indicator { background:red; display:inline-block; border:1px solid black; width:0.5em; height:0.5em;  } \r\n		comment { display:none;  }\r\n</style>\r\n</p>\r\n\r\n<h3>Titres of &quot;O&quot; antigen &ge;1:80 and &quot;H&quot; antigen &ge;1:160 are considered significant</h3>\r\n\r\n<h3>Rising titres are significant.</h3>\r\n\r\n<h3>Limitations of the test include cross-reactivity with other Salmonella species, inability to distinguish current and previous infection or vaccination against typhoid.</h3>\r\n\r\n<h3>WHO recommends cultures to be performed whenever possible</h3>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-08-02 11:27:37', '2017-08-02 17:32:55', NULL),
(2, 4221, '<ul>\r\n	<li>Confirmatory testing by smear examination recommended for all positive results</li>\r\n	<li>Test targets a pan-malarial antigen and an antigen specific to&nbsp;<em>Plasmodium</em>&nbsp;<em>falciparum</em></li>\r\n	<li>Discrepant results between malaria antigen results and smear microscopy may arise due to:</li>\r\n</ul>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Cross reactivity with autoantibodies e.g. rheumatoid factor</li>\r\n	<li>Parasitemia below the detection limit of microscopy</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Some malaria antigens can remain in the blood for up to 28 days after the parasites have been killed by drugs</li>\r\n</ul>\r\n', '2017-08-03 10:05:48', '2017-08-10 17:54:50', NULL),
(3, 4260, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:619px;\" width=\"464\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"9\" height=\"12\" style=\"height:16px;width:619px;\">\r\n			<ul>\r\n				<li>Standard intensity warfarin target INR therapeutic range: 2.0 to 3.0; High intensity warfarin target INR therapeutic range: 2.5 to 3.5</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr height=\"14\">\r\n			<td colspan=\"5\" height=\"14\" style=\"height:19px;\">\r\n			<ul>\r\n				<li>Normal PT value is within &plusmn; 3 seconds of the control value</li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"9\" height=\"12\" style=\"height:16px;\">\r\n			<ul>\r\n				<li>The test assesses for defects in the extrinsic &amp; common pathways i.e.&nbsp; factors VII, FX, FV, FII &amp;/or fibrinogen</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 06:47:34', '2017-08-04 20:01:19', NULL),
(4, 4217, '<ul>\r\n	<li>Normal aPTT value is within &plusmn; 6 seconds of the control value</li>\r\n	<li>Therapeutic target for unfractionated heparin is between 1.5-2.5 times the control value</li>\r\n	<li>aPTT may be prolonged due to heparin contamination, pre-analytical problems e.g. insufficient or clotted blood sample; deficiencies in&nbsp; the intrinsic coagulation pathway (i.e. factor XI, factor IX, factor VIII, factor V) or common pathway (i.e. factor II [prothrombin]) and fibrinogen; inhibitors like lupus anticoagulant</li>\r\n</ul>\r\n', '2017-08-04 06:48:03', '2017-08-10 17:58:22', NULL),
(5, 4225, '<ul>\r\n	<li>In conjunction with clinical pre-test probability (e.g. Well&rsquo;s score), D-dimer has high negative predictive value for venous thromboembolism (DVT/PE).</li>\r\n	<li>levated D-dimer levels also occur with increasing age, recent surgery, hematomas, thromboembolism, trauma, pregnancy. Inflammation, malignancy, liver disease etc.</li>\r\n</ul>\r\n', '2017-08-04 06:48:33', '2017-08-23 15:11:57', 'Remarks '),
(6, 4891, '<ul>\r\n	<li>PT and aPTT are recommended tests.</li>\r\n</ul>\r\n', '2017-08-04 06:49:16', '2017-08-23 15:34:05', 'Remarks '),
(7, 4262, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:773px;\" width=\"580\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"14\">\r\n			<td colspan=\"9\" height=\"14\" style=\"height:19px;width:619px;\">\r\n			<ul>\r\n				<li>Positive result points to in-vivo sensitization of RBCs by demonstrating coating of RBCs with IgG &amp;/or C3d</li>\r\n				<li>Indicated in the evaluation of hemolytic transfusion reactions, AIHA, drug-induced hemolytic anemia, hemolytic disease of newborn</li>\r\n			</ul>\r\n			</td>\r\n			<td style=\"width:84px;\">&nbsp;</td>\r\n			<td style=\"width:71px;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"14\">\r\n			<td colspan=\"11\" height=\"14\" style=\"height:19px;\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 06:50:24', '2017-08-04 20:38:38', NULL),
(8, 4263, '<ul>\r\n	<li>Looks for antibodies circulating in blood direct against RBCs</li>\r\n	<li>Used in compatibility testing, evaluation of hemolytic transfusion reactions, detection of feto-maternal blood type incompatibility</li>\r\n</ul>\r\n', '2017-08-04 06:51:04', '2017-08-10 16:38:57', NULL),
(9, 4070, '<ul>\r\n	<li>&nbsp;Bence Jones proteins consist of monoclonal immunoglobulin light chains associated with various monoclonal gammopathies.</li>\r\n	<li>&nbsp;The test may be positive occasionally for other proteins and positive results should always be confirmed by electrophoresis.</li>\r\n	<li>&nbsp;Bradshaw test is performed on spot urine</li>\r\n</ul>\r\n', '2017-08-04 06:51:31', '2017-08-10 11:07:34', NULL),
(10, 4247, '\n		<p>Adult reference intervals are derived from NCEP ATP III guidelines; pediatric reference intervals are derived from the Expert panel on integrated guidelines for cardiovascular health and risk reduction in children and adolescents: summary report. Pediatrics 2011 Dec;128 Suppl 5:S213-S256; &lt;2years testing not recommended</td>\n		</p>\n		\n			<p>Fasting is preferred but not mandatory; triglyceride &amp; calculated LDL cholesterol results may be unreliable in non-fasting state</td>\n			</p>\n', '2017-08-04 06:52:10', '2017-08-04 06:52:10', NULL),
(11, 4911, '<ul>\r\n	<li>The presence of hemoglobin variants and/or changes in RBC lifespan (e.g. blood loss, hemolytic anemia, splenomegaly) may affect the accuracy of HbA1c results</li>\r\n	<li>&middot;HbA1c is a standard tool for monitoring glycemic control in patients with diabetes. Adult therapeutic goal is usually &lt;7.0%. Action suggested if &gt;8.0%</li>\r\n	<li>&middot;Iron deficiency anemia may falsely elevate HbA1c</li>\r\n</ul>\r\n', '2017-08-04 06:54:51', '2017-08-10 16:47:04', NULL),
(12, 4858, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:548px;\" width=\"411\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"5\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"14\">\r\n			<td colspan=\"8\" height=\"14\" style=\"height:19px;width:548px;\">\r\n			<p>A screen positive result is a 1hr post load value &ge;7.8; OGTT should be performed</p>\r\n\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:265px;\" width=\"199\">\r\n				<colgroup>\r\n					<col span=\"2\" />\r\n					<col />\r\n					<col />\r\n				</colgroup>\r\n				<tbody>\r\n					<tr height=\"12\">\r\n						<td colspan=\"3\" height=\"12\" style=\"height:16px;width:195px;\">Reference: ADA 2017 guidelines</td>\r\n						<td style=\"width:71px;\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:02:27', '2017-08-04 07:02:27', NULL),
(13, 4909, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:619px;\" width=\"464\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"8\" height=\"12\" style=\"height:16px;width:548px;\">Reference values are derived from ADA 2017 guidelines; IGT= impaired glucose tolerance</td>\r\n			<td style=\"width:71px;\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:04:36', '2017-08-04 07:04:36', NULL),
(14, 4224, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:844px;\" width=\"633\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col span=\"2\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"12\" height=\"12\" style=\"height:16px;width:844px;\">A diagnosis of Gestational Diabetes Mellitus (GDM) is made if at least 2 of the 4 (fasting, 1hr, 2hr, 3hr) plasma glucose thresholds are met or exceeded</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td height=\"12\" style=\"height:16px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:05:16', '2017-08-04 07:05:16', NULL),
(15, 4054, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:336px;\" width=\"252\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"2\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"4\" height=\"12\" style=\"height:16px;width:265px;\">Average risk: 1.0-3.0; High risk: &gt;3.0</td>\r\n			<td style=\"width:71px;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"5\" height=\"12\" style=\"height:16px;\">Used as a cardiovascular risk assessment biomarker</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:05:36', '2017-08-04 07:05:36', NULL),
(16, 4922, '<ol>\r\n	<li>To establish consistent findings &amp; exclude transient elevations (e.g. from intercurrent illness, posture, strenous exercise etc.), it is recommended that abnormal findings are confirmed with a first morning or timed urine sample. Incase of discrepancies, a third sample should be collected.</li>\r\n	<li>uACR is a valid screening tool for early diabetic nephropathy</li>\r\n</ol>\r\n', '2017-08-04 07:08:13', '2017-08-23 21:03:19', 'Remarks '),
(17, 4904, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:477px;\" width=\"358\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"4\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"7\" height=\"12\" style=\"height:16px;width:477px;\">Result accuracy depends on a properly collected and timed 24hr urine sample</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:08:48', '2017-08-04 07:08:48', NULL),
(18, 4913, '<ul>\r\n	<li>Used as a cardiovascular risk assessment biomarker. Average risk: 1.0-3.0; High risk: &gt;3.0&nbsp;</li>\r\n</ul>\r\n', '2017-08-04 07:11:22', '2017-08-10 14:54:53', NULL),
(19, 4203, '<ul>\r\n	<li>&nbsp;In adults, &lt;20 ng/mL is considered deficient; 20-29 ng/mL as insufficient; 30-80 as optimum and levels &gt;150 as possible toxicity.</li>\r\n	<li>&nbsp;In children (0-17 years), &nbsp;&lt;20ng/mL is considered deficient and &ge;20ng/mL as optimum.</li>\r\n	<li>&nbsp;There is a high prevalence of deficiency and insufficiency. Low levels occur due to lack on&nbsp; sunlight exposure, inadequate intake, malabsorption, advanced liver disease and antiepileptic drugs.</li>\r\n	<li>&nbsp;Hypervitaminosis may occur with supplementation of high vitamin D doses and result in hypercalcemia and hyperphosphatemia.</li>\r\n</ul>\r\n', '2017-08-04 07:12:44', '2017-08-11 10:12:48', NULL),
(20, 4926, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:548px;\" width=\"411\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"5\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"8\" height=\"12\" style=\"height:16px;width:548px;\">\r\n			<ul>\r\n				<li>A 4th generation assay that &nbsp;detects the presence of HIV 1/2 antibodies &amp;/or p24 antigen by ELFA technology.</li>\r\n				<li>Specimens that test positive are rechecked by a different method in line with NASCOP HTS algorithm.</li>\r\n				<li>All reactive specimens should be confirmed by repeat testing on new samples &amp;/or by molecular techniques (PCR).</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:18:39', '2017-08-11 10:32:45', NULL),
(21, 4268, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:703px;\" width=\"527\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"51\">\r\n			<td colspan=\"10\" height=\"51\" style=\"height:68px;width:703px;\">\r\n			<ul>\r\n				<li>&nbsp;0-4 ng/mL is considered as the conventional reference interval for all age groups. However PSA results rise over various decades in life i.e. &lt;40 years: &le;2; 40-49: &le;2.5; 50-59: &le;3.5; 60-69: &le;4.5; 70-79: &le;6.5; &ge;80 years: &le;7.2 (Oesterling JE, Jacobsen SJ, Chute CG, et al: Serum prostate-specific antigen in a community-based population of healthy men. JAMA 1993 Aug 18;270:860-864)</li>\r\n				<li>In conjunction with digital rectal exam, total PSA may be used as an initial screening test for prostate cancer</li>\r\n				<li>&nbsp;Indicated in prognosis, staging and monitoring of prostate cancer patients</li>\r\n				<li>Increased levels may be seen in BPH, prostatitis, following prostatic massage or digital rectal examination. False increase may be seen due to interference by heterophile antibodies and clinical correlation is always required.</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr height=\"14\">\r\n			<td colspan=\"9\" height=\"14\" style=\"height:19px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"14\">\r\n			<td colspan=\"7\" height=\"14\" style=\"height:19px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"25\">\r\n			<td colspan=\"10\" height=\"25\" style=\"height:34px;width:703px;\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:22:22', '2017-08-04 20:43:13', NULL),
(22, 4932, '<p>Titres of &quot;O&quot; antigen &ge;1:80 and &quot;H&quot; antigen &ge;1:160 are considered significant.</p>\r\n\r\n<p>Rising titres are significant.</p>\r\n\r\n<p>Limitations of the test include cross-reactivity with other Salmonella species, inability to distinguish current and previous infection or vaccination against typhoid.</p>\r\n\r\n<p>WHO recommends cultures to be performed whenever possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2017-08-04 07:22:36', '2017-08-24 11:18:16', 'Remarks'),
(23, 4287, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:1197px;\" width=\"898\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col span=\"7\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"16\" height=\"12\" style=\"height:16px;width:1127px;\">Conventional&nbsp;culture&nbsp;and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents)</td>\r\n			<td style=\"width:71px;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"11\" height=\"12\" style=\"height:16px;\">Results should be correlated with urinalysis, how the urine was collected (e.g. clean catch versus suprapubic aspirate) and the clinical picture</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:23:03', '2017-08-04 07:23:03', NULL),
(24, 4931, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:336px;\" width=\"252\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"2\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"5\" height=\"12\" style=\"height:16px;width:336px;\">Immunochromatographic test on spot or early morning urine</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:24:52', '2017-08-04 07:24:52', NULL),
(25, 4176, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:703px;\" width=\"527\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"8\" height=\"12\" style=\"height:16px;width:548px;\">A positive results indicates likely exposure to TB i.e. latent (past) or active (present) TB</td>\r\n			<td style=\"width:71px;\">&nbsp;</td>\r\n			<td style=\"width:84px;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"10\" height=\"12\" style=\"height:16px;\">Positive results are common in persons with prior BCG vaccination; cross reactivity with other mycobacteria may occur</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td height=\"12\" style=\"height:16px;\">Reference:&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"2\" height=\"12\" style=\"height:16px;\">CDC guidelines</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:25:21', '2017-08-04 07:25:21', NULL),
(26, 4285, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:915px;\" width=\"686\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col span=\"3\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"12\" height=\"12\" style=\"height:16px;width:844px;\">Reference values are derived from lower limits (5th percentile) in the WHO 2010 laboratory manual for the examination and processing of human semen</td>\r\n			<td style=\"width:71px;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td height=\"12\" style=\"height:16px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:27:14', '2017-08-04 07:27:14', NULL),
(27, 4937, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:1127px;\" width=\"845\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"16\" height=\"12\" style=\"height:16px;width:1127px;\">\r\n			<ul>\r\n				<li>Conventional&nbsp;culture&nbsp;and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents)</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"4\" height=\"12\" style=\"height:16px;\">\r\n			<ul>\r\n				<li>Positive cultures are reported immediately</li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"8\" height=\"12\" style=\"height:16px;\">\r\n			<ul>\r\n				<li>Interim reports are issued after 48 hours and a final report at 5 days if there is no growth</li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:27:41', '2017-08-14 15:01:06', ''),
(28, 4936, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:1127px;\" width=\"845\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"16\" height=\"12\" style=\"height:16px;width:1127px;\">\r\n			<ul>\r\n				<li>Conventional&nbsp;culture&nbsp;and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents)</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"4\" height=\"12\" style=\"height:16px;\">\r\n			<ul>\r\n				<li>Positive cultures are reported immediately</li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"8\" height=\"12\" style=\"height:16px;\">\r\n			<ul>\r\n				<li>Interim reports are issued after 48 hours and a final report at 5 days if there is no growth</li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:28:36', '2017-08-14 15:01:37', ''),
(29, 4940, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:1127px;\" width=\"845\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"16\" height=\"12\" style=\"height:16px;width:1127px;\">Conventional&nbsp;culture&nbsp;and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents)</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"7\" height=\"12\" style=\"height:16px;\">Growth of group B streptococci (S. agalactiae) is reported only in pregnant women</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"10\" height=\"12\" style=\"height:16px;\">Asymptomatic colonization with Candida occurs in some women; growth of Candida therefore requires clinical correlation</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-04 07:29:34', '2017-08-04 07:29:34', NULL),
(30, 4845, '<p>Single negative smear does not exclude malaria infection</p>\r\n', '2017-08-04 20:13:02', '2017-08-04 20:13:02', NULL),
(31, 4894, '<ul>\r\n	<li>Standard intensity warfarin target INR therapeutic range: 2.0 to 3.0; High intensity warfarin target INR therapeutic range: 2.5 to 3.5</li>\r\n	<li>Normal PT value is within &plusmn; 3 seconds of the control value</li>\r\n	<li>The test assesses for defects in the extrinsic &amp; common pathways i.e.&nbsp; factors VII, FX, FV, FII &amp;/or fibrinoge</li>\r\n</ul>\r\n', '2017-08-07 14:32:13', '2017-08-07 14:36:25', NULL),
(32, 4894, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:773px;\" width=\"580\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"12\">\r\n			<td colspan=\"11\" height=\"12\" style=\"height:16px;width:773px;\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr height=\"14\">\r\n			<td colspan=\"5\" height=\"14\" style=\"height:19px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"9\" height=\"12\" style=\"height:16px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-07 14:34:25', '2017-08-07 14:36:05', NULL),
(33, 4894, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:773px;\" width=\"580\">\r\n	<colgroup>\r\n		<col span=\"2\" />\r\n		<col />\r\n		<col span=\"6\" />\r\n		<col />\r\n		<col />\r\n	</colgroup>\r\n	<tbody>\r\n		<tr height=\"14\">\r\n			<td colspan=\"5\" height=\"14\" style=\"height:19px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"12\">\r\n			<td colspan=\"9\" height=\"12\" style=\"height:16px;\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-07 14:34:42', '2017-08-07 14:35:21', NULL),
(34, 4259, '<ul>\r\n	<li>All positive results must be confirmed by hemoglobin electrophoresis/ HPLC studies</li>\r\n	<li>False negative results may occur when hemoglobin S is &lt;20%</li>\r\n</ul>\r\n', '2017-08-10 10:38:24', '2017-08-10 10:38:24', NULL),
(35, 4263, '<ul>\r\n	<li>Looks for antibodies circulating in blood direct against RBCs</li>\r\n	<li>Used in compatibility testing, evaluation of hemolytic transfusion reactions, detection of feto-maternal blood type incompatibility</li>\r\n</ul>\r\n', '2017-08-10 10:39:32', '2017-08-10 10:39:32', NULL),
(36, 4262, '<ul>\r\n	<li>Positive result points to in-vivo sensitization of RBCs by demonstrating coating of RBCs with IgG &amp;/or C3d</li>\r\n	<li>Indicated in the evaluation of hemolytic transfusion reactions, AIHA, drug-induced hemolytic anemia, hemolytic disease of newborn</li>\r\n</ul>\r\n', '2017-08-10 10:40:15', '2017-08-10 10:40:15', NULL),
(37, 4843, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:451px;\" width=\"449\">\r\n	<tbody>\r\n		<tr height=\"17\">\r\n			<td colspan=\"11\" height=\"17\" style=\"height:17px;width:451px;\">\r\n			<ul>\r\n				<li>Used to assess bone marrow response in anemia &amp; other hematologic disorders</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2017-08-10 14:38:54', '2017-08-10 14:38:54', NULL),
(38, 4536, '<ul>\r\n	<li>ESR is a non-specific test used as a marker of inflammation.</li>\r\n	<li><span style=\"line-height: 1.6em;\">Related tests include CRP, procalcitonin, rheumatoid factor.</span></li>\r\n</ul>\r\n', '2017-08-10 16:56:44', '2017-08-10 17:06:55', NULL),
(39, 4203, '<ul>\r\n	<li>In adults, &lt;20 ng/mL is considered deficient; 20-29 ng/mL as insufficient; 30-80 as optimum and levels &gt;150 as possible toxicity.</li>\r\n	<li>In children (0-17 years), &nbsp;&lt;20ng/mL is considered deficient and &ge;20ng/mL as optimum</li>\r\n	<li>There is a high prevalence of deficiency and insufficiency. Low levels occur due to lack on sunlight exposure, inadequate intake, malabsorption, advanced liver disease and antiepileptic drugs</li>\r\n	<li>There is a high prevalence of deficiency and insufficiency. Low levels occur due to lack on sunlight exposure, inadequate intake, malabsorption, advanced liver disease and antiepileptic drugs</li>\r\n</ul>\r\n', '2017-08-11 10:05:41', '2017-08-11 10:05:41', NULL),
(40, 5009, '<ul>\r\n	<li>High sensitivity assays can detect elevated levels of Troponin I (above the 99th percentile) within 3-6 hours after the onset of myocardial infarction or ischemic damage.</li>\r\n	<li>Elevated troponin levels also occurs in conditions other than myocardial infarction. Examples include cardiac causes like myocarditis, congestive heart failure, (unstable) angina, cardiac surgery as well as noncardiac causes like pulmonary embolism.</li>\r\n	<li>Reference intervals may vary between labs and are dependent on the method of measurement used.</li>\r\n	<li>ng/L is the IFCC recommended reporting unit.</li>\r\n</ul>\r\n', '2017-08-11 10:25:51', '2017-08-11 10:25:51', NULL),
(41, 4929, '<ul>\r\n	<li>0-4 ng/mL is considered as the conventional reference interval for all age groups. However PSA results rise over various decades in life i.e. &lt;40 years: &le;2; 40-49: &le;2.5; 50-59: &le;3.5; 60-69: &le;4.5; 70-79: &le;6.5; &ge;80 years: &le;7.2 (Oesterling JE, Jacobsen SJ, Chute CG, et al: Serum prostate-specific antigen in a community-based population of healthy men. JAMA 1993 Aug 18;270:860-864).</li>\r\n	<li>In conjunction with digital rectal exam, total PSA may be used as an initial screening test for prostate cancer.</li>\r\n	<li>Indicated in prognosis, staging and monitoring of prostate cancer patients.</li>\r\n	<li>Increased levels may be seen in BPH, prostatitis, following prostatic massage or digital rectal examination. False increase may be seen due to interference by heterophile antibodies and clinical correlation is always required.</li>\r\n</ul>\r\n', '2017-08-11 10:49:24', '2017-08-11 10:49:24', NULL),
(42, 4956, '<p>Light&#39;s criteria (pleural fluid) and SAAG (ascitic fluid) are useful for distinguishing between transudates and exudates. Both require concurrent collection of serum and fluid samples</p>\r\n', '2017-08-11 16:44:22', '2017-08-11 16:44:22', NULL),
(43, 4879, '<p>RBCs:&nbsp;Microcytic hypochromic; anisopoikilocytosis with target cells, cigar forms</p>\r\n\r\n<p>WBCs:&nbsp;Neutropenia</p>\r\n\r\n<p>Platelets:&nbsp;Increased with occasional giant forms</p>\r\n\r\n<p>Impression/ Advice:&nbsp;Features suggestive of iron deficiency anemia. Serum ferritin recommended</p>\r\n', '2017-08-12 14:07:22', '2017-08-12 19:51:34', 'PBF findings'),
(44, 4254, '<ul>\r\n	<li>Microscopic examination is performed on saline and iodine wet mounts</li>\r\n</ul>\r\n', '2017-08-14 14:56:39', '2017-08-14 14:56:39', ''),
(45, 5042, '<ul>\r\n	<li>Immunochromatographic test on spot or early morning urine</li>\r\n</ul>\r\n', '2017-08-14 14:57:09', '2017-08-14 14:57:09', ''),
(46, 4176, '<ul>\r\n	<li>A positive results indicates likely exposure to TB i.e. latent (past) or active (present) TB.</li>\r\n	<li>Positive results are common in persons with prior BCG vaccination; cross reactivity with other mycobacteria may occur.</li>\r\n</ul>\r\n', '2017-08-14 14:57:45', '2017-08-14 14:57:45', ''),
(47, 5051, '<ul>\r\n	<li>Smear microscopy should be used in conjunction with culture or GeneXpert when evaluating a patient&#39;s TB status.</li>\r\n</ul>\r\n', '2017-08-14 14:58:12', '2017-08-24 18:44:53', 'Remarks '),
(48, 4286, '<ul>\r\n	<li>Conventional culture and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents).</li>\r\n</ul>\r\n', '2017-08-14 14:58:49', '2017-08-14 14:58:49', ''),
(49, 4286, '<ul>\r\n	<li>Conventional culture and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents).</li>\r\n</ul>\r\n', '2017-08-14 14:58:49', '2017-08-14 14:58:49', ''),
(50, 4285, '<ul>\r\n	<li>Reference values are derived from lower limits (5th percentile) in the WHO 2010 laboratory manual for the examination and processing of human semen.</li>\r\n</ul>\r\n', '2017-08-14 14:59:09', '2017-08-14 14:59:09', ''),
(51, 4937, '<ul>\r\n	<li>Conventional culture and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents).</li>\r\n	<li>Positive cultures are reported immediately.</li>\r\n	<li>Interim reports are issued after 48 hours and a final report at 5 days if there is no growth.</li>\r\n</ul>\r\n', '2017-08-14 15:00:01', '2017-08-14 15:00:01', ''),
(52, 4942, '<ul>\r\n	<li>Conventional culture and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents).</li>\r\n	<li>Deep respiratory secretions and not saliva should be provided.</li>\r\n</ul>\r\n', '2017-08-14 15:02:31', '2017-08-14 15:02:31', ''),
(53, 4940, '<ul>\r\n	<li>Conventional culture and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents).</li>\r\n	<li>Growth of group B streptococci (S. agalactiae) is reported only in pregnant women.</li>\r\n	<li>Asymptomatic colonization with Candida occurs in some women; growth of Candida therefore requires clinical correlation.</li>\r\n</ul>\r\n', '2017-08-14 15:03:19', '2017-08-14 15:03:19', ''),
(54, 4935, '<ul>\r\n	<li>Conventional culture and bacterial identification techniques employed; Antibacterial susceptibility testing done by Kirby Bauer method in accordance with CLSI guidelines (M2 and M100 documents).</li>\r\n</ul>\r\n', '2017-08-14 15:03:45', '2017-08-14 15:03:45', ''),
(55, 4956, '<ul>\r\n	<li>Light&#39;s criteria (pleural fluid) and SAAG (ascitic fluid) are useful for distinguishing between transudates and exudates. Both require concurrent collection of serum and fluid samples.</li>\r\n</ul>\r\n', '2017-08-14 15:05:23', '2017-08-14 15:05:23', '');
